import styled from "styled-components";

export const ItemContainer = styled.div`
  width: 80%;

  h3 {
    font-family: "Inter";
    font-style: normal;
    font-weight: 700;
    font-size: 20px;
    line-height: 24px;
    color: #000000;
  }
  p {
    font-family: "Inter";
    font-style: normal;
    font-weight: 700;
    font-size: 13px;
    line-height: 16px;
    color: rgba(0, 0, 0, 0.49);
  }
  h2 {
    font-family: "Inter";
    font-style: normal;
    font-weight: 700;
    font-size: 15px;
    line-height: 18px;

    color: rgba(0, 0, 0, 0.8);
  }
`;
